const Footer = props => (
  <div>
    <div className="footerBox">
      <p className="footerTitle">CSE 330 Creative Project</p>
      <p className="footerBody"> Created By: Jon Bueff and Joe Frazier</p>
    </div>
  <style jsx>{`
    .footerBox{
        background: black;  
        position: fixed;
        bottom: 0;      
    }
    .footerTitle{
        color: white;
    }
    .footerBody{
        color: white;
    }
  `}
  </style>
  </div>
);



export default Footer;
